import React, { useContext, useEffect } from 'react';

import Login from '../Login/Login';
import Card from '../UI/Card/Card';
import classes from './Home.module.css';
import homeImage from '../../assets/formula.jfif';
import AuthContext from '../../store/auth-context';

const Home = (props) => {

  let loginFrom = (props.openLogin) ? true : false;

  useEffect(() => {
    console.log('set')

    return () => {
      loginFrom = false;
      console.log('cleanup')
    };
  }, [loginFrom]);

  return (
    <React.Fragment>
      <div className={classes.background}>
        <img src={homeImage} alt="Formula" className={classes.img} />
      </div>
      <Card className={classes.home}>{loginFrom && <Login />}</Card>
    </React.Fragment>
  );
};

export default Home;
